 import "./PaymentProcessor.sol";

contract Student {

    address public student_address;

    struct StudentInfo {
        string mat_Num;
        string name;
        uint token_balance;
    }

    PaymentProcessor public payment;

    StudentInfo [] list_of_student;
    mapping (address => StudentInfo) Students;

    constructor(PaymentProcessor _payment) {
      payment = _payment;
    }

    function createStudent (string memory _mat_Number, string memory _name) external {
      StudentInfo memory studentInfo = StudentInfo(_mat_Number, _name, 0);
      student_address = msg.sender;
      Students[student_address] = studentInfo;
      list_of_student.push(studentInfo);
    }

    function getStudentProfile (string memory _mat_Number) external view returns(string memory, string memory) {
